import React, { ReactNode } from "react";
import CircularProgress from "@material-ui/core/CircularProgress";
import Button from "@material-ui/core/Button";
import Box from "@material-ui/core/Box";

export function GoogleConnect({
  children = "Sign in with Google",
  loading = false,
  onClick
}) {
  return (
    <Button
      style={{
        maxWidth: 220,
        textTransform: "none",
        borderRadius: 20,
        height: 39
      }}
      onClick={onClick}
      disabled={loading}
      variant="contained"
      fullWidth
    >
      <GoogleLogo style={{ transform: "translateY(1px)" }} />
      {loading ? (
        <Box ml={1}>
          <CircularProgress size={16} color="inherit" />
        </Box>
      ) : null}
    </Button>
  );
}

function GoogleLogo({ style }) {
  return (
    <svg viewBox="0 0 70 24" width={70} height={24} fill="none" style={style}>
      <path fill="url(#prefix__pattern_google)" d="M0 0h70v24H0z" />
      <defs>
        <pattern
          id="prefix__pattern_google"
          patternContentUnits="objectBoundingBox"
          width={1}
          height={1}
        >
          <use
            xlinkHref="#prefix__image_google"
            transform="matrix(.0008 0 0 .0023 -.007 0)"
          />
        </pattern>
        <image
          id="prefix__image_google"
          width={1280}
          height={433}
          xlinkHref="data:image/png;base64,"
        />
      </defs>
    </svg>
  );
}
